steps.name:
Sending request to url: https://www.uulastaging.com/backend/graphql
         With query {"operationName":"GetCurrentCountry","variables":{},"query":"query GetCurrentCountry {
  currentCountry {
    ...CurrentCountryFragment
    __typename
  }
}

fragment CurrentCountryFragment on CurrentCountry {
  country {
    id
    code
    name
    englishName
    locale {
      name
      value
      __typename
    }
    __typename
  }
  currentLocale {
    name
    value
    __typename
  }
  __typename
}
"}
